import { render } from '@testing-library/react';
import React from 'react';
import './styles/main.css';
import Movie from './components/movie';
import data from './components/data';

function App() {

  let name = [];
  let year = [];

  Object.keys(data).forEach(key => {
      name.push(data[key].title);
      year.push(data[key].year);
  })

console.log(name);
console.log(year);

  return (
    <div className="container">
      <div className="input-container">
        <label>Search for a Movie</label>
        <input type="text"></input>
      </div>

      <div className="movies-container">
          <Movie title="Avengers" year="2005"></Movie>
          <Movie title="Black Widow" year="2010"></Movie>
          <Movie title="Frozen 2" year="2011"></Movie>
          <Movie title="Scary Movie" year="2005"></Movie>
          <Movie title="Star Wars" year="2005"></Movie>
          <Movie title="Santana" year="2013"></Movie>
          <Movie title="Date Movie" year="2005"></Movie>
          <Movie title="Bad Boys" year="2019"></Movie>
      </div>

    </div>

  );
}

export default App;
